import { ImageResponse } from "next/og";

import { db } from "~/server/db";

const BASE_URL = "https://myiso.app";

function resolveUrl(url: string): string {
  if (!url) return "";
  if (url.startsWith("http://") || url.startsWith("https://")) return url;
  return `${BASE_URL}${url.startsWith("/") ? "" : "/"}${url}`;
}

const LOGO_BASE64 = "data:image/png;base64,";

export async function GET(request: Request) {
  const { searchParams } = new URL(request.url);
  const handle = searchParams.get("handle");

  if (!handle) {
    return new Response("Missing handle parameter", { status: 400 });
  }

  const photographer = await db.photographer.findFirst({
    include: { user: true },
    where: { user: { handle } },
  });

  if (!photographer) {
    return new Response("Photographer not found", { status: 404 });
  }

  const name = photographer.name || "Photographer";
  const location = photographer.location || "";
  const company = photographer.companyName || "";
  const rawAvatarUrl = resolveUrl(photographer.avatar || "");
  const avatarUrl = rawAvatarUrl || "";

  return new ImageResponse(
    (
      <div
        style={{
          display: "flex",
          flexDirection: "row",
          width: 1200,
          height: 630,
          background:
            "linear-gradient(135deg, #1a1a2e 0%, #16213e 50%, #0f3460 100%)",
          padding: 60,
        }}
      >
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            justifyContent: "center",
            alignItems: "flex-start",
            flex: 1,
            paddingRight: 40,
          }}
        >
          {avatarUrl ? (
            <img
              src={avatarUrl}
              style={{
                width: 120,
                height: 120,
                borderRadius: 60,
                objectFit: "cover",
                border: "3px solid rgba(255,255,255,0.3)",
                marginBottom: 24,
              }}
            />
          ) : (
            <div
              style={{
                display: "flex",
                width: 120,
                height: 120,
                borderRadius: 60,
                background: "rgba(255,255,255,0.15)",
                alignItems: "center",
                justifyContent: "center",
                marginBottom: 24,
                fontSize: 48,
                color: "white",
              }}
            >
              {name.charAt(0)}
            </div>
          )}
          <div style={{ display: "flex", flexDirection: "column" }}>
            <div
              style={{
                fontSize: 48,
                fontWeight: 700,
                color: "white",
                lineHeight: 1.2,
                marginBottom: 8,
              }}
            >
              {name}
            </div>
            {company ? (
              <div
                style={{
                  fontSize: 24,
                  color: "rgba(255,255,255,0.7)",
                  marginBottom: 12,
                }}
              >
                {company}
              </div>
            ) : null}
            {location ? (
              <div
                style={{
                  display: "flex",
                  alignItems: "center",
                  fontSize: 22,
                  color: "rgba(255,255,255,0.6)",
                }}
              >
                {location}
              </div>
            ) : null}
          </div>
        </div>
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            justifyContent: "flex-end",
            alignItems: "flex-end",
          }}
        >
          <img
            src={LOGO_BASE64}
            style={{ width: 80, height: 80, opacity: 0.9 }}
          />
          <div
            style={{
              fontSize: 18,
              color: "rgba(255,255,255,0.5)",
              marginTop: 8,
            }}
          >
            myiso.app
          </div>
        </div>
      </div>
    ),
    {
      headers: {
        "Cache-Control":
          "public, max-age=86400, s-maxage=604800, stale-while-revalidate=86400",
      },
      height: 630,
      width: 1200,
    },
  );
}
